using System;
using Xamarin.Forms;
using AppName.Core;
using Newtonsoft.Json;
using System;
using System.Collections.Generic;
using System.Net.Http;
using System.Net.Http.Headers;
using System.Threading.Tasks;
using Xamarin.Forms;
using Rg.Plugins.Popup.Services;
using System.Collections.ObjectModel;
using System.Globalization;
using AppName.ViewModels.BarCode.Model;
using AppName.Model;
using AppName.Services;
using System.Diagnostics;
using System.Windows.Input;
using System.Net;
using System.IO;
using System.Text;
using System.Linq;
using AppName.CustomRenderer;

namespace AppName
{
    public class CheckItemDayPageViewModel : BaseViewModel
    {
        public ObservableCollection<CheckSaleModel> Items { get; set; }
        public Command LoadItemsCommand { get; set; }
        public Command<string> SearchItemsCommand { get; set; }

        private CheckSaleModel _barcode;
        private string _itemno;
        private bool _isHasData;
        private bool _isMess;
        private bool _isCheck;

        public string ItemNo
        {
            get => _itemno;

            set => SetProperty(ref _itemno, value);
        }

        public bool IsMess
        {
            get => _isMess;

            set => SetProperty(ref _isMess, value);
        }

        public bool IsHasData
        {
            get => _isHasData;

            set => SetProperty(ref _isHasData, value);
        }

        public bool IsCheck
        {
            get => _isCheck;

            set => SetProperty(ref _isCheck, value);
        }

        public CheckItemDayPageViewModel()
        {
            Items = new ObservableCollection<CheckSaleModel>();
            LoadItemsCommand = new Command(async () => await ExecuteLoadItemsCommand());
            SearchItemsCommand = new Command<string>(ExecuteSearchItemsCommand);

            IsCheck = false;

            MessagingCenter.Subscribe<App, string>((App)Xamarin.Forms.Application.Current, "BarcodeDatalogic", async (sender, thebarcode) =>
            {
                ItemNo = thebarcode.Substring(0, thebarcode.Length - 1);

                LoadData(thebarcode.Substring(0, thebarcode.Length - 1));
            });
        }

        async Task ExecuteLoadItemsCommand()
        {
            if (IsBusy)
                return;

            IsBusy = true;

            try
            {
                Items.Clear();

                var model = new CheckSaleModel();
                model.BarcodeNo = "8936089070035";
                model.Image = "";
                model.ItemName = "Item Name(Demo)";
                model.LocationCode = "Store code";

                model.ImageSource = ConvertImageBase64.ConvertImage(model.Image);

                Items.Add(model);
            }
            catch (Exception ex)
            {
                Debug.WriteLine(ex);
            }
            finally
            {
                IsBusy = false;
            }
        }

        public CheckSaleModel BarCode
        {
            get { return _barcode; }
            set { SetProperty(ref _barcode, value); }
        }

        public async void ExecuteSearchItemsCommand(string keyvalue)
        {
            if (keyvalue == "")
            {
                Items.Clear();
            }
            else
            {
                LoadData(keyvalue);
            }
        }

        public partial class ResuftCheckStockModel
        {
            public bool Active { get; set; }
            public ChecksaleJsonModel ListData { get; set; }
        }
        protected async void LoadData(string KeyValue)
        {
            if (CheckConnectInternet.IsConnectedNotClearCookie() == false)
            {
                return;
            }

            if (IsBusy)
                return;
            IsBusy = true;

            try
            {
                var authHeader = new AuthenticationHeaderValue("bearer", Application.Current.Properties["Token"].ToString().Replace("Bearer", ""));

                HttpClient client = new HttpClient();

                client.DefaultRequestHeaders.Authorization = authHeader;

                var model = new
                {
                    LocationCode = "",
                    ItemNo = KeyValue
                };

                var stringContent = new StringContent(model.ToString(), UnicodeEncoding.UTF8, "application/json");

                var url = "";
                if (IsCheck == true)
                {
                    url = RealmHelper.Instance.All<UserLSRetailConfig>().FirstOrDefault().URLApi + "/api/products/CheckSalesQuantity?LocationCode=" + "" + "&ItemNo=" + KeyValue + "&day=133";

                }
                else
                {
                    var userName = Application.Current.Properties["UserName"]?.ToString();
                    url = RealmHelper.Instance.All<UserLSRetailConfig>().FirstOrDefault().URLApi + "/api/products/CheckSalesQuantity?LocationCode=" + userName + "&ItemNo=" + KeyValue + "&day=133";
                }

                Uri uri = new Uri(string.Format(url, string.Empty));

                HttpResponseMessage response = await client.PostAsync(uri, stringContent);

                var mess = response.Content.ReadAsStringAsync().Result;

                if (response.IsSuccessStatusCode)
                {
                    string content = await response.Content.ReadAsStringAsync();

                    var dataList = JsonConvert.DeserializeObject<ResuftCheckStockModel>(content);
                    if (dataList.Active == false)
                    {
                        Application.Current.Properties["IsLogin"] = false;

                        Application.Current.MainPage = new NavigationPage(new LoginFrm());

                        Application.Current.MainPage.DisplayAlert("Notification !", "The device has not been activated, Please contact the administrator to activate.", "OK");

                        return;
                    }

                    var listModel = new List<CheckSaleModel>();

                    Items.Clear();

                    if (dataList.ListData.data.Count > 0)
                    {
                        if (dataList.ListData.data != null)
                        {
                            foreach (var data in dataList.ListData.data)
                            {
                                var modelData = new CheckSaleModel();
                                modelData.BarcodeNo = data.BarcodeNo;
                                modelData.ItemName = data.ProductDescriptionEN + " " + data.ItemNo;
                                modelData.ItemNameVN = data.ProductDescriptionVN + " " + data.ItemNo;
                                modelData.ItemNo = data.ItemNo;
                                modelData.UnitPrice = Convert.ToInt32(data.UnitPrice).ToString("#,##");
                                modelData.LocationCode = data.LocationCode;
                                modelData.StoreName = data.StoreName;
                                modelData.Inventory = Convert.ToInt32(data.Stock);
                                modelData.Image = data.Image;
                                modelData.Category = data.Category;
                                modelData.SubCategoryName = data.SubCategoryName;
                                modelData.FIXID_SHELF = data.FIXID_SHELF;
                                modelData.Nhap = Convert.ToInt32(data.Nhap);
                                modelData.Xuat = Convert.ToInt32(data.Xuat);
                                modelData.UnPosted = Convert.ToInt32(data.UnPosted);
                                modelData.HHPOG_TOTALUNIT = Convert.ToInt32(data.HHPOG_TOTALUNIT);
                                modelData.Sold_Qty_With_Days = Convert.ToInt32(data.Sold_Qty_With_Days);

                                if (string.IsNullOrEmpty(modelData.Image))
                                {
                                    modelData.Image = "";
                                }

                                modelData.ImageSource = ConvertImageBase64.ConvertImage(modelData.Image);

                                CheckSaleModel i = modelData;
                                Items.Add(i);
                            }
                        }
                    }
                    else
                    {
                        var dialog = new NotificationWarrningPopup(this.GetType().Name, CheckConnectInternet.GetmethodName()) { Message = "There is nothing to show in this view :=" + KeyValue };
                        PopupNavigation.Instance.PushAsync(dialog, false);
                    }
                }
            }
            catch (Exception ex)
            {
                IsBusy = false;
                var dialog = new NotificationWarrningPopup(this.GetType().Name, CheckConnectInternet.GetmethodName()) { Message = ex.Message };
                PopupNavigation.Instance.PushAsync(dialog, false);
            }
            finally
            {
                IsBusy = false;
            }
        }
    }
}
